tables.table_schema:
CREATE TABLE Table1 (
    id INT PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    demand_data TEXT,
    INDEX idx_demand_data (demand_data)
);

CREATE TABLE Table2 (
    id INT PRIMARY KEY,
    product_id INT NOT NULL,
    price DECIMAL(10, 2) NOT NULL,
    INDEX idx_product_id_price (product_id, price)
);

CREATE TABLE Table3 (
    id INT PRIMARY KEY,
    category VARCHAR(50) NOT NULL,
    quantity INT NOT NULL,
    INDEX idx_category_quantity (category, quantity)
);

CREATE TABLE Table4 (
    id INT PRIMARY KEY,
    date DATE NOT NULL,
    demand INT NOT NULL,
    INDEX idx_date_demand (date, demand)
);

CREATE TABLE Table5 (
    id INT PRIMARY KEY,
    customer_id INT NOT NULL,
    location VARCHAR(100) NOT NULL,
    INDEX idx_customer_location (customer_id, location)
);
